import React from 'react';

function copyAddressToClipboard(token) {
  let addressElement = document.getElementById(token + '-address');

  try {
    let res = document.execCommand('copy');
    let msg = res ? 'success' : 'failed';
    console.log('Copying ' + msg);
  } catch (err) {
    console.log('Error: Oops, unable to copy!');
  }
}

function WalletAddress(props) {
  const token = props.token;
  const address = props.children;

  const handleClick = e => {
    if (e.detail === 2) // double click
      return copyAddressToClipboard(token);
  };

  return (
    <p onClick={handleClick}>
      <b>{token.toUpperCase()}</b>
      <span className='address-container' id={token + '-address'}>{address}</span>
    </p>
  );
}

export default function Contacts() {
  return (
    <section id="contacts">
      <p>
        Hi, it&apos;s me!
      </p>

      <p>
        <a href='https://www.reddit.com/user/cherrynoize'>
          u/cherrynoize
        </a>
      </p>

      <p>
        <a href='https://twitter.com/noizecherry9987'>
          @noizecherry9987
        </a>
      </p>

      <p>
        <a href='https://github.com/cherrynoize'>
          github.com/cherrynoize
        </a>
      </p>

      <p>
        <a href='mailto:cherrynoize@duck.com'>
          cherrynoize@duck.com
        </a>
      </p>

      <p>
        Please feel free to contact me about any feedback or
        request. If you find a bug in an application on GitHub,
        please open a public issue or send a pull request.
      </p>

      <p>
        If you want to show your support (or just buy me a
        Pepsi):
      </p>

      <WalletAddress token='eth'>
        0x5938C4DA9002F1b3a54fC63aa9E4FB4892DC5aA8
      </WalletAddress>

      <WalletAddress token='sol'>
        G77bErQLYatQgMEXHYUqNCxFdUgKuBd8xsAuHjeqvavv
      </WalletAddress>

      <WalletAddress token='bnb'>
        0x0E0eAd7414cFF412f89BcD8a1a2043518fE58f82
      </WalletAddress>

      <WalletAddress token='lunc'>
        terra1n5sm6twsc26kjyxz7f6t53c9pdaz7eu6zlsdcy
      </WalletAddress>

      <p>
        Thank you for using my software.
      </p>
    </section>
  );
}
